import React from 'react'
import { Text, View } from 'react-native'

const Footer = ({likesCount, caption, postedAt}) => {
    return (
        <View>
            <Text>{likesCount}</Text>
            <Text>{caption}</Text>
            <Text>{caption}</Text>
        </View>
    )
}

export default Footer
